function WheelRotate() {
	this.rotateFun = function(g, f, h) {		//obj  f:1-5随机数  h:回调
		if (!g.ele || !g.prizeList || !f) {
			return
		}
		this.obj = g;
		this.p = f;
		b(this.obj.ele, d(this.p, this.obj), h)
	};
	var d = function(k, l) {	        //k:1-5随机数    l：obj			
		if (!k || !l.prizeList) {
			return
		}
		var f = l.prizeList;
		var h = f.length;
		var i = e(f, k);        //f:prizeList  k:1-5随机数  i:可能获奖序号组成的数组
		var j = Math.floor(Math.random() * (i.length)),  //i中的随机项
			g = i[j];
		f[g].message.deg = 360 / h / 2 + 360 / h * (f[g].rank - 1);
		return f[g].message
	};
	var e = function(k, h) {  //k:prizeList  h:1-5随机数
		var g = [];
		for (var j = 0, f = k.length; j < f; j++) {
			if (k[j].prize == h) {
				g.push(j)
			}
		}
		return g
	};
	var a = function(g, f) {
		g.css({
			"-moz-transform": "rotate(" + f + "deg)",
			"-webkit-transform": " rotate(" + f + "deg)",
			"-o-transform": "rotate(" + f + "deg)",
			"-ms-transform": "rotate(" + f + "deg)",
			transform: " rotate(" + f + "deg)",
		})
	};
	var c = function(h, f) {
		var j = 1;
		var i = f / 30;
		var g = h / 30;
		j = i / 2 - Math.abs(g - i / 2);
		j = j <= 1 ? 1 : j;
		return j
	};
	var b = function(i, f, k) {    //i:指针   f:所获奖项的message    k:回调
		if (!f) {
			return
		} 
		var h = f.deg || null;
		h += 5040;
		var g = 1;
		var j = window.setInterval(function() {
			var l = c(g, h);
			if (g >= h) {
				window.clearInterval(j);
				if (k != undefined) {
					k(f)
				}
				return
			}
			a(i, g);
			g += l
		}, 1)
	}
};